import Post from "../component/Post";
import axios from "axios";

const IndexPage = () => 
{
  const [posts,setPosts]=useState([]);
  useEffect(() => {

    async function getdata()
    {
      const data=await axios.get("http://localhost:3000/post");
      setPosts(data)
    }
    getdata();
  
  }, []);
  return (
    <div>
      <Post />
      <Post />
      <Post />
    </div>
  );
};

export default IndexPage;
